/*
    建立 txstudioAIR 範例資料庫需要的資料表與預設資料內容
*/
CREATE DATABASE [txstudioAIR]
GO

USE [txstudioAIR]
GO

CREATE SCHEMA [Flight]
GO

CREATE TABLE [Flight].[FlightSchedules]
(
	[No]				INT,
	[FlightNumber]		VARCHAR(5),

	[FlightDate]		DATETIMEOFFSET(0),

	CONSTRAINT [pk_FlightSchedules] PRIMARY KEY ([No]),

	CONSTRAINT [un_FlightSchedules_FlightNubmer]
		UNIQUE ([FlightDate],[FlightNumber])
)
GO

